import React, { useEffect, useState } from "react";
import {
  ChartComponent,
  SeriesCollectionDirective,
  SeriesDirective,
  Inject,
  DateTime,
  CandleSeries,
  Tooltip,
  Zoom,
  Crosshair,
} from "@syncfusion/ej2-react-charts";
import { registerLicense } from "@syncfusion/ej2-base";

// Register the Syncfusion license
registerLicense("Ngo9BigBOggjHTQxAR8/V1NMaF5cXmRCf1FpRmJGdld5fUVHYVZUTXxaS00DNHVRdkdmWX5ednVWQ2BfVEJ+WEY=");

const CandlestickChart = ({ ticker, entryPoint, exitPoint, additionalData }) => {
  const [chartData, setChartData] = useState([]);
  const [sentimentData, setSentimentData] = useState({});
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchChartAndSentimentData = async () => {
      try {
        // Fetch candlestick chart data
        const chartResponse = await fetch(`http://localhost:5000/api/candlestick?ticker=${ticker}`);
        const chartData = await chartResponse.json();

        if (!chartData.dates) {
          setError("No chart data available for this stock.");
          return;
        }

        const formattedChartData = chartData.dates.map((date, index) => ({
          x: new Date(date),
          open: chartData.open[index],
          high: chartData.high[index],
          low: chartData.low[index],
          close: chartData.close[index],
        }));

        // Fetch sentiment data
        const sentimentResponse = await fetch(
          `http://localhost:5000/api/sentiment-plot?ticker=${ticker}&start_date=2023-01-01&end_date=2023-12-31`
        );
        const sentimentData = await sentimentResponse.json();

        const aggregatedSentiment = {
          positive: sentimentData.positive.reduce((a, b) => a + b, 0),
          negative: sentimentData.negative.reduce((a, b) => a + b, 0),
          neutral: sentimentData.neutral.reduce((a, b) => a + b, 0),
        };

        setChartData(formattedChartData);
        setSentimentData(aggregatedSentiment);
        setError("");
      } catch (err) {
        console.error(`Error fetching data for ${ticker}:`, err);
        setError("Failed to load data.");
      }
    };

    fetchChartAndSentimentData();
  }, [ticker]);

  return (
    <div className="chart-container">
      {error ? (
        <p style={{ color: "red", textAlign: "center" }}>{error}</p>
      ) : (
        <>
          <ChartComponent
            id={`chart-${ticker}`}
            primaryXAxis={{ valueType: "DateTime", labelFormat: "MMM dd", intervalType: "Days" }}
            primaryYAxis={{ labelFormat: "${value}" }}
            tooltip={{ enable: true }}
            crosshair={{ enable: true, lineType: "Both" }}
            zoomSettings={{ enableMouseWheelZooming: true, mode: "XY" }}
            height="400px"
            width="100%"
          >
            <Inject services={[CandleSeries, DateTime, Tooltip, Zoom, Crosshair]} />
            <SeriesCollectionDirective>
              <SeriesDirective
                dataSource={chartData}
                xName="x"
                open="open"
                high="high"
                low="low"
                close="close"
                type="Candle"
                name="Price"
              />
            </SeriesCollectionDirective>
          </ChartComponent>

          <div className="chart-info">
            <h3 className="chart-title">{ticker}</h3>
            <div className="chart-stats">
              <p><strong>Volatility:</strong> {additionalData?.volatility || "N/A"}</p>
              <p><strong>Change:</strong> {additionalData?.change || "N/A"}</p>
              <p><strong>RSI:</strong> {additionalData?.rsi || "N/A"}</p>
              <p><strong>Positive Sentiment:</strong> {sentimentData.positive || 0}</p>
              <p><strong>Negative Sentiment:</strong> {sentimentData.negative || 0}</p>
              <p><strong>Neutral Sentiment:</strong> {sentimentData.neutral || 0}</p>
            </div>
            <div className="price-info">
              <p><strong>Entry Point:</strong> ${entryPoint.toFixed(2)}</p>
              <p><strong>Exit Point:</strong> ${exitPoint.toFixed(2)}</p>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default CandlestickChart;
